import React, { useState, useEffect } from 'react';
import LaunchList from './LaunchList';

const LaunchListContainer = () => {
  const [sortKey, setSortKey] = useState('');
  const [launches, setLaunches] = useState([]);

  const handleSort = (key) => {
    setSortKey(key);
  };

  const sortLaunches = (launches, key) => {
    return [...launches].sort((a, b) => {
      if (key === 'flight_number') {
        return a.flight_number - b.flight_number;
      }
      if (key === 'name') {
        return a.name.localeCompare(b.name);
      }
      if (key === 'launch_date') {
        return new Date(a.date_utc) - new Date(b.date_utc);
      }
      return 0;
    });
  };

  useEffect(() => {
    // Fetch launches and update launches state
    // ...

    // Sort launches based on sortKey
    const sortedLaunches = sortLaunches(launches, sortKey);
    setLaunches(sortedLaunches);
  }, [sortKey]);

  return (
    <div>
      <h1>Launch List Container</h1>
      <button onClick={() => handleSort('flight_number')}>Sort by Flight Number</button>
      <button onClick={() => handleSort('name')}>Sort by Name</button>
      <button onClick={() => handleSort('launch_date')}>Sort by Launch Date</button>
      <LaunchList launches={launches} />
    </div>
  );
};

export default LaunchListContainer;
